// Desectructaracion de Arrays

const personajes = ["Goku", "Vegeta", "Picolor"];
console.log(personajes);

console.log(personajes[0]);
console.log(personajes[1]);
console.log(personajes[2]);

const [p1, p2, p3] = personajes;

console.log(p1);
console.log(p2);
console.log(p3);
